  //   // alert(position);
  //   // this.setState({
  //   //   left: position.left,
  //   //   top: position.top
  //   // });
  // }
  sketch = p => {
    p.setup = function() {
      p.createCanvas(600, 520);
    };

    p.draw = function() {
      if (p.mouseIsPressed) {
        p.fill(0);
      } else {
        p.fill(255);
      }
      p.ellipse(p.mouseX, p.mouseY, 80, 80);
    };
  };

  render() {
    return (
      <div className="app">
        <div className="container">
          <div className="canvas1">
            <P5Wrapper sketch={this.sketch} />
            {/* <h1 className="h1-1"> Hello</h1> */}
          </div>
          <div className="canvas2">
            <P5Wrapper sketch={this.sketch} />
            {/* <h1 className="h1-2"> Hello0000</h1> */}
          </div>
        </div>
        <div className="center">
          <h1>Hello</h1>
        </div>
        <div className="container">
          <div className="canvas3">
            <P5Wrapper sketch={this.sketch} />
            {/* <h1 className="h1-1"> Hello</h1> */}
          </div>
          <div className="canvas4">
            <P5Wrapper sketch={this.sketch} />
            {/* <h1 className="h1-2"> Hello0000</h1> */}
          </div>
        </div>
      </div>
    );
  }
}

export default App;
